    let result = unsafe { __div_mod(7, 3, 11) };
    // 3^(-1) mod 11 = 4 (since 3 * 4 = 12 = 1 mod 11)
    // 7 * 4 = 28 = 6 (mod 11)
    assert(result == 6);
    // Verify: result * 3 = 7 (mod 11)
    // Safety: Test function calling unconstrained helper
    assert(unsafe { __mul_mod(result, 3, 11) } == 7);
